import style from './mystyle.module.css';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn
} from 'mdb-react-ui-kit';

function ProfileCard({professionalExperience, image, body}){
    //argument destructuring
    // const {professionalExperience} = props
    return (
            <MDBCard className='style.card'>
                <imMDBCardImage src={image} position='top' className={style.cardimage} alt="Job Images" />
                <MDBCardBody>
                    <MDBCardText>

                        <p className={style.cardtitle}>{professionalExperience}</p>
                        <p className={style.cardtext}></p>
                    </MDBCardText>
                </MDBCardBody>
            </MDBCard>
    );
}

export default ProfileCard;
